script: |
  super -f text -I q5612.spq | sort > q5612.out

inputs:
  - name: q5612.spq
    data: |
      SELECT DISTINCT - col0 - 68 * 82 AS col0 FROM tab2 (FORMAT parquet) WHERE - ( col2 ) + - 79 * 28 IS NOT NULL;
  - name: tab2

outputs:
  - name: q5612.out
    data: |
      -5622
      -5640
      -5651
